import { useState } from 'react';
import './App.css';
import './Navbar.css';
import './Header.css';
import './Credits.css';
import Navbar from './Navbar.js';
import Header from './Header.js';
import AboutMe from './AboutMe';
import Credits from './Credits';
import ProjectState from './ProjectState';

function App() {
  let curState = new ProjectState();
  let [verticalMode, updateVerticalMode] = useState(document.body.clientWidth < document.body.clientHeight);
  window.addEventListener("resize", () => {
    updateVerticalMode(document.body.clientWidth < document.body.clientHeight);
  });

  return (
    <>
      <Header />
      <Navbar curState={curState}/>
      <div className={verticalMode ? "center-wrapper" : "center-wrapper thin"}>
      <AboutMe />
      <Credits />
      </div>
    </>
  );
}

export default App;
